import React from "react";
import dropdown from "../../images/down-arrow.svg";
import { EnrollBox, DropdownCustom } from "./styled";

const EnrollCard = (props) => {
  const { isClick } = props;
  return (
    <EnrollBox>
      <div>tuop</div>
      <div style={{ display: "flex" }}>
        <div>0/3</div>
        {isClick ? <DropdownCustom src={dropdown} alt="dropdown" /> : <DropdownCustom src={dropdown} alt="dropdown" />}
        <DropdownCustom src={dropdown} alt="dropdown" />
      </div>
    </EnrollBox>
  );
};

export default EnrollCard;
